import axios from 'axios';
import React, { useEffect, useState } from 'react';

const Cards = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios
            .get("https://swapi.dev/api/people/1/")
            .then((res) => setData(res.data));
    }, []);

    return (
        <div className='Cards'>
            <h1>SW Cards :D</h1>
            <ul>
                {
                    data.products.map((card) => (
                        <li>{card.name}</li>))
                }
            </ul>
        </div>
    );
};

export default Cards;
